dell'attivita' di:
presso l'unita' locale le attivita', esercitate direttamente e/o tramite
imprese partecipate, di:
a. messa a punto di stampi sotto pressa, manutenzione e montaggio di stampi;
b. avviamento stampaggio su linee di produzione;
c. avviamento, messa a punto e manutenzione di linee di assemblaggio di
particolari per carrozzerie;
d. lavorazione di polistirolo, legno, resine e metalli;
e. produzione, lavorazione, assemblaggio e lavorazione di modelli per fonderie
ed affini;
f. sviluppo della progettazione di modelli in forma tridimensionale per la
costruzione di stampi, nonche' consulenza tecnica e tecnologica in ambito studi
di imbutitura e tecnologia per la progettazione e la costruzione di stampi;
g. progettazione e disegno di parti meccaniche, nonche' prestazione di servizi
di consulenza in tale ambito di attivita';
h. progettazione e costruzione di attrezzature e di linee di produzione per
l'assemblaggio di particolari per carrozzerie;
i. progettazione, realizzazione ed installazione di scenografie, di impianti
pubblicitari ed affissionali, di articoli reclamistici e per l'arredamento, con
qualsiasi tipo di materiale (polistirolo, legno, resine e metalli);
j. progettazione di sistemi per l'allestimento di interni ed esterni civili,
industriali, nautici, per trasporto terrestre e non (quali uffici mobili,
imbarcazioni, officine mobili eccetera);
k. stampa digitale (di piccolo e grande formato) su qualsiasi materiale e
supporto;
l. verniciatura speciale con sistemi aerografici (manuali/computerizzati e
digitali);
m. progettazione, costruzione e commercializzazione di macchinari inerenti alle
lavorazioni qui con-template;
n. engineering di processo e preventivazione dei relativi costi;
o. intermediazione (in qualsiasi forma consentita; e cosi', a titolo
esemplificativo e non esaustivo, l'assunzione e la concessione di mandati di
procacciamento d'affari, di agenzia e, piu' in generale, di rappresentanza
commerciale - ivi compresa l'assunzione della funzione di concessionaria e/o
commissionaria -) relativa ai beni e servizi di cui sopra.

